  {
    "title": "Of Money, and Other Economic Essays",
    "id": "https://www.feedbooks.com/book/6709",
    "author": {
      "name": "David Hume",
      "uri":
          "https://catalog.feedbooks.com/publicdomain/browse/recent.atom?author_id=2171&lang=en"
    },
    "published": "2013-04-02T17:20:54Z",
    "updated": "2022-02-09T04:12:39Z",
    "dcterms:language": "en",
    "dcterms:publisher": "Feedbooks",
    "dcterms:issued": "1777",
    "summary":
        "David Hume is known for his philosophical writings, but he also wrote on politics, history, and economics.  This eBook contains 7 economic essays which were first published in Hume's Political Discourses (1752) and republished in Essays and Treatises on Several Subjects, Volume 1 (1758, 1777). One essay has been praised by the Nobel-Prize-winning economist, Paul Krugman, who said in his newspaper column:\n\n\"... Hume also helped found economics: his 'Of the Balance of Trade', published 34 years before The Wealth of Nations, was arguably the first example of modern economic reasoning, based on what amounts to a stylized model, albeit one without any equations or diagrams.\" (New York Times, 8 May 2011, \"Hume Day\".) ... \"You could argue that modern economics really began with David Hume\u2019s 'Of the Balance of Trade', whose core is a gloriously clear thought experiment....\" (ibid., 2 Feb 2011,  \"Models, Plain and Fancy\".)\n\nAdam Smith (1723-1790), the author of The Wealth of Nations (1776), is commonly considered the \"father of modern economics\", but Hume pre-dated Smith in that regard.  Both were Scottish philosophers of the Scottish Enlightenment, and although Hume was a decade older than Smith, they became lifelong friends after they met in 1750.\n\nThe essays cover Commerce, Money, Interest, Balance of Trade, Jealousy of Trade, Taxes, and Public Credit (national debt).  Hume explained economic phenomena we observe even today, such as the self-correction of job migration to lower cost countries, money supply issues, the undesirable results of tariffs, military buildup in underdeveloped countries, and other topics that give insights into the happenings we read about in the news almost daily.\n\nThis eBook is available only for personal and educational uses, non-commercial, with attribution to the source www.davidhume.org.",
